import { observable, action } from "mobx";
import axios from "axios";

export class admin {
  @observable dbTable = {};

  @action
  createTableInfo(dbname) {
    console.log(dbname);
    return axios
      .get("https://hanstream.gabia.io/adminCreateFile", {
        params: {
          dbName: dbname,
        },
      })
      .then((response) => {
        alert("추가완료했습니다.");
        console.log(response.data);
      })
      .catch((error) => {
        alert("error");
        console.log(error);
      });
  }
  @action
  async createTable(dbname) {
    await this.createTableInfo(dbname);
  }
  @action
  getTableInfo() {
    return axios
      .get("https://hanstream.gabia.io/adminDBTable", {})
      .then((response) => {
        console.log(response.data);
      })
      .catch((error) => {
        console.log(error);
      });
  }
  @action
  async getTable() {
    await this.getTableInfo();
  }
}
